import axios from 'axios';
import React, { useEffect, useState } from 'react';


const BlocVoitures = () => {

    const [listeVoitures, setListeVoitures] = useState([])

    useEffect(() => {
        const fetchVoitures = async () => {
            try {
                const response = await axios.get("https://public.opendatasoft.com/api/explore/v2.1/catalog/datasets/all-vehicles-model/records?limit=20");
                setListeVoitures(Array.from(response.data.results));
            } catch (error) {
                console.error("Erreur lors de la récupération des voitures", error);
            }
        };
        fetchVoitures();
    }, []);

    listeVoitures.map((voitures) => (
        console.log(voitures.make)
    ));

    return (
        <div>
            <div>
                {listeVoitures.map((voitures, index) => (
                    <p key={index}>numéro : {index} marque : {voitures.make}</p>
                ))}
            </div>
        </div>
    );
};

export default BlocVoitures;
